import React, { useState } from 'react';
import { View, TextInput, StyleSheet, Picker, Button } from 'react-native';

const ArtistForm = () => {
  const [selectedCountry, setSelectedCountry] = useState("Select Country");
  const [fileUpload, setFileUpload] = useState(null);

  const handleFileUpload = () => {
    // Handle file upload logic
    console.log("File uploaded:", fileUpload);
  };

  return (
    <View style={styles.container}>
      <TextInput
        placeholder="First Name"
        style={styles.input}
      />
      <TextInput
        placeholder="Last Name"
        style={styles.input}
      />
      <TextInput
        placeholder="Email"
        style={styles.input}
      />
      <TextInput
        placeholder="Phone"
        style={styles.input}
      />
      <TextInput
        placeholder="City & State"
        style={styles.input}
      />
      <Picker
        selectedValue={selectedCountry}
        style={styles.countryPicker}
        onValueChange={(itemValue, itemIndex) =>
          setSelectedCountry(itemValue)
        }>
        <Picker.Item label="Select Country" value="Select Country" />
        <Picker.Item label="Country 1" value="Country 1" />
        <Picker.Item label="Country 2" value="Country 2" />
        {/* Add more countries as needed */}
      </Picker>
      <TextInput
        placeholder="Pincode"
        style={styles.input}
      />
      <TextInput
        placeholder="Full Address"
        style={styles.input}
      />
      <TextInput
        placeholder="ID Proof"
        style={styles.input}
      />
      <TextInput
        placeholder="ID Proof Name and Number"
        style={styles.input}
      />
      <Button
        title="Upload Proof"
        onPress={() => {} /* Add file upload logic here */}
      />
      <TextInput
        placeholder="Age"
        style={styles.input}
      />
      <TextInput
        placeholder="DOB"
        style={styles.input}
      />
      <TextInput
        placeholder="Gender"
        style={styles.input}
      />
      <TextInput
        placeholder="Height"
        style={styles.input}
      />
      <TextInput
        placeholder="Weight"
        style={styles.input}
      />
      <Button
        title="Submit"
        onPress={() => {} /* Add submit logic here */}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    marginBottom: 20,
  },
  input: {
    borderWidth: 1,
    borderColor: 'gray',
    borderRadius: 5,
    padding: 10,
    marginBottom: 10,
  },
  countryPicker: {
    borderWidth: 1,
    borderColor: 'gray',
    borderRadius: 5,
    marginBottom: 10,
  },
});

export default ArtistForm;
